import { StyledInputs, StyledLabel } from "./style";

export const Inputs = ({ placeholder, type, register, text }) => {
  return (
    <>
      <StyledLabel>{text}</StyledLabel>
      <StyledInputs placeholder={placeholder} type={type} {...register} />
    </>
  );
};
